import styled from 'styled-components';

const Style = (props) => {
  const StyledCounter = styled.div`
    .darkTheme {
      --user-color: ${props.color};
    }
    .lightTheme {
      --user-color: #ff0000;
    }
  `;
  return <StyledCounter>{props.children}</StyledCounter>;
};
const StyleCustom = (props) => {
  return <StyledCounter>{props.children}</StyledCounter>;
};

export default StyleCustom;
